<!DOCTYPE html>
<html lang="ja">
<head>
<meta charset="utf-8">
<meta http-equiv="X-UA-Compatible" content="IE=edge">
<meta name="viewport" content="width=device-width, initial-scale=1">
<title>葉と根の観察アプリ（レガシー対応版）</title>
<style>
*{box-sizing:border-box}body{margin:0;font-family:Segoe UI,Roboto,'Noto Sans JP','Yu Gothic','Meiryo',sans-serif;background:#f7fafc;color:#111}
header{position:sticky;top:0;background:#fff;border-bottom:1px solid #e5e7eb;z-index:5}
.bar{max-width:1100px;margin:0 auto;padding:10px 16px;display:flex;gap:8px;align-items:center;justify-content:space-between}
h1{margin:0;font-size:20px}
.btn{border:1px solid #cbd5e1;background:#fff;border-radius:8px;padding:7px 11px;cursor:pointer}
.tabs{max-width:1100px;margin:14px auto;padding:0 16px}
.tabbar{display:flex;gap:8px;margin-bottom:10px}
.tabbar .btn.active{background:#2563eb;color:#fff;border-color:#2563eb}
.card{background:#fff;border:1px solid #e5e7eb;border-radius:12px;padding:14px}
.gallery{display:grid;grid-template-columns:repeat(auto-fill,minmax(180px,1fr));gap:12px}
.thumb{border:1px solid #e5e7eb;border-radius:10px;overflow:hidden;background:#fff}
.thumb img{width:100%;height:130px;object-fit:cover;background:#000;display:block}
.thumb .meta{padding:8px}
.viewer{border:1px solid #e5e7eb;border-radius:12px;overflow:hidden;background:#111}
.photo-wrap{position:relative;width:100%;height:520px;background:#000;overflow:hidden}
.photo-wrap img{position:absolute;left:0;top:0;transform-origin:0 0;width:auto;height:100%;user-select:none}
.zoombar{display:flex;gap:8px;align-items:center;padding:8px 10px;border-top:1px solid #e5e7eb;background:#fafafa;flex-wrap:wrap}
.small{font-size:12px;color:#6b7280}.spacer{flex:1}
</style>
</head>
<body>
<header><div class="bar"><h1>葉と根の観察アプリ（レガシー対応）</h1></div></header>
<main class="tabs">
  <div class="tabbar">
    <button class="btn active" id="tab-manage" onclick="showPanel('manage')">① 画像一覧</button>
    <button class="btn" id="tab-observe" onclick="showPanel('observe')">② 観察</button>
    <button class="btn" id="tab-compare" onclick="showPanel('compare')">③ 比較</button>
  </div>

  <section id="panel-manage" class="card">
    <p class="small">内蔵画像（ナズナ根／スズメノカタビラ根／単子葉の葉／双子葉の葉）。カードの「観察」で拡大へ。</p>
    <div id="gallery" class="gallery"></div>
  </section>

  <section id="panel-observe" class="card" style="display:none">
    <div style="display:flex;gap:8px;align-items:center;margin-bottom:8px">
      <strong id="title">未選択</strong><span class="spacer"></span>
      <button class="btn" onclick="showPanel('manage')">← 一覧へ</button>
    </div>
    <div class="viewer">
      <div id="wrap" class="photo-wrap"><img id="img" alt="観察画像"></div>
      <div class="zoombar">
        <label>拡大：<input id="zoom" type="range" min="1" max="8" step="0.05" value="1" onchange="zoomSlider()" oninput="zoomSlider()"></label>
        <button class="btn" onclick="setZoom(1)">1x</button>
        <button class="btn" onclick="setZoom(2)">2x</button>
        <button class="btn" onclick="setZoom(4)">4x</button>
        <button class="btn" onclick="resetView()">リセット</button>
        <span class="spacer"></span><span class="small">ドラッグで移動／ホイールで拡大</span>
      </div>
    </div>
  </section>

  <section id="panel-compare" class="card" style="display:none">
    <div style="display:grid;grid-template-columns:1fr 1fr;gap:12px">
      <div class="viewer">
        <div class="photo-wrap" id="wrapL"><img id="imgL"></div>
        <div class="zoombar"><label>拡大：<input id="zoomL" type="range" min="1" max="6" step="0.05" value="1" onchange="zoomSide('L')" oninput="zoomSide('L')"></label><button class="btn" onclick="resetSide('L')">リセット</button></div>
      </div>
      <div class="viewer">
        <div class="photo-wrap" id="wrapR"><img id="imgR"></div>
        <div class="zoombar"><label>拡大：<input id="zoomR" type="range" min="1" max="6" step="0.05" value="1" onchange="zoomSide('R')" oninput="zoomSide('R')"></label><button class="btn" onclick="resetSide('R')">リセット</button></div>
      </div>
    </div>
  </section>
</main>

var DATA = [];
for(var i=0;i<EMBEDDED.length;i++){ var d=EMBEDDED[i]; DATA.push({id:d.id||('e'+i),name:d.name,part:d.part,species:d.species,dataURL:d.dataURL}); }

function byId(id){ return document.getElementById(id); }
function showPanel(id){
  var ids=['manage','observe','compare'];
  for(var i=0;i<ids.length;i++){
    var pid='panel-'+ids[i], tid='tab-'+ids[i];
    byId(pid).style.display = (ids[i]===id)?'block':'none';
    var tab=byId(tid); if(tab){ if(ids[i]===id){ tab.className='btn active'; } else { tab.className='btn'; } }
  }
}

// ------- Gallery -------
function renderGallery(){
  var g=byId('gallery'); g.innerHTML='';
  for(var i=0;i<DATA.length;i++){
    (function(d){
      var dv=document.createElement('div'); dv.className='thumb';
      dv.innerHTML = '<img src="'+d.dataURL+'" alt="'+d.name+'">'+
        '<div class="meta"><div style="display:flex;gap:8px;align-items:center"><strong>'+ (d.species||'') +'</strong>'+
        '<span class="spacer"></span><button class="btn">観察</button></div>'+
        '<div class="small">'+d.part+'／'+d.name+'</div></div>';
      dv.getElementsByTagName('button')[0].onclick=function(){ openObserve(d); };
      g.appendChild(dv);
    })(DATA[i]);
  }
}
renderGallery();

// ------- Observe viewer (mouse wheel + drag) -------
var img = byId('img'); var wrap = byId('wrap');
var scale=1, tx=0, ty=0, dragging=false, lx=0, ly=0;
function apply(){ img.style.transform='translate('+tx+'px,'+ty+'px) scale('+scale+')'; }
function resetView(){ scale=1; tx=0; ty=0; byId('zoom').value='1'; apply(); }
function setZoom(z){ scale=z; byId('zoom').value=String(z); apply(); }
function zoomSlider(){ var ns=parseFloat(byId('zoom').value||'1'); scale=ns; apply(); }

wrap.onmousedown=function(e){ dragging=true; lx=e.clientX; ly=e.clientY; };
window.onmousemove=function(e){ if(dragging){ tx+=e.clientX-lx; ty+=e.clientY-ly; lx=e.clientX; ly=e.clientY; apply(); } };
window.onmouseup=function(){ dragging=false; };
wrap.onwheel=function(e){ e=e||window.event; if(e.preventDefault) e.preventDefault(); var delta = (e.deltaY>0)?-0.12:0.12; var ns=Math.min(8, Math.max(1, scale+delta)); scale=ns; byId('zoom').value=String(scale); apply(); return false; };

function openObserve(d){
  showPanel('observe');
  byId('title').textContent = (d.species||'') + '／' + d.part + '／' + d.name;
  img.src = d.dataURL; resetView();
}

// ------- Compare (simple) -------
function makeSide(idWrap,idImg){
  var wrap=byId('wrap'+idWrap), img=byId('img'+idWrap);
  var s=1,x=0,y=0,drag=false,lx=0,ly=0;
  function ap(){ img.style.transform='translate('+x+'px,'+y+'px) scale('+s+')'; img.style.width='auto'; img.style.height='100%'; img.style.objectFit='contain'; }
  wrap.onmousedown=function(e){ drag=true; lx=e.clientX; ly=e.clientY; };
  window.addEventListener('mousemove', function(e){ if(drag){ x+=e.clientX-lx; y+=e.clientY-ly; lx=e.clientX; ly=e.clientY; ap(); } }, false);
  window.addEventListener('mouseup', function(){ drag=false; }, false);
  return { load:function(src){ img.src=src; s=1;x=0;y=0; byId('zoom'+idWrap).value='1'; ap(); },
           zoom:function(){ s=parseFloat(byId('zoom'+idWrap).value||'1'); ap(); },
           reset:function(){ s=1;x=0;y=0; byId('zoom'+idWrap).value='1'; ap(); } };
}
var sideL = makeSide('L'), sideR = makeSide('R');
function zoomSide(which){ (which==='L'?sideL:sideR).zoom(); }
function resetSide(which){ (which==='L'?sideL:sideR).reset(); }

// 初期で左右に1枚ずつ表示
if(DATA[0]) sideL.load(DATA[0].dataURL);
if(DATA[1]) sideR.load(DATA[1].dataURL);
</script>
